import React, { useState } from 'react';

const VoterManagement = () => {
  const [formData, setFormData] = useState({
    cnic: '',
    name: '',
    email: '',
    phone: '',
    address: '',
    dateOfBirth: '',
    password: '',
    newPassword: '',
    newEmail: '',
    city: '',
    constituency: '',
    twoFactorCode: '',
  });

  const [token, setToken] = useState(null);
  const [message, setMessage] = useState('');

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSignup = async () => {
    try {
      const response = await fetch('/voter/signup', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData),
      });
      const data = await response.json();
      setMessage(data.message);
    } catch (error) {
      console.error(error);
      setMessage('Error signing up');
    }
  };

  const handleLogin = async () => {
    try {
      const response = await fetch('http://localhost:5000/voter/login', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ cnic: formData.cnic, password: formData.password }),
      });
      const data = await response.json();
      if (data.token) {
        setToken(data.token);
      }
      setMessage(data.message);
    } catch (error) {
      console.error(error);
      setMessage('Error logging in');
    }
  };

  const handleUpdate = async () => {
    try {
      const response = await fetch('/voter/update', {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify(formData),
      });
      const data = await response.json();
      setMessage(data.message);
    } catch (error) {
      console.error(error);
      setMessage('Error updating voter info');
    }
  };

  const handleVerify = async () => {
    try {
      const response = await fetch('/voter/verify', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify({ twoFactorCode: formData.twoFactorCode }),
      });
      const data = await response.json();
      setMessage(data.message);
    } catch (error) {
      console.error(error);
      setMessage('Error verifying voter');
    }
  };

  return (
    <div style={styles.container}>
      <h1>Voter Management</h1>
      <p>{message}</p>

      {/* Login Section */}
      <div style={styles.section}>
        <h2>Login</h2>
        <div style={styles.formGroup}>
          <input
            type="text"
            name="cnic"
            placeholder="CNIC"
            value={formData.cnic}
            onChange={handleChange}
            style={styles.input}
          />
          <input
            type="password"
            name="password"
            placeholder="Password"
            value={formData.password}
            onChange={handleChange}
            style={styles.input}
          />
        </div>
        <button onClick={handleLogin} style={styles.button}>Login</button>
      </div>

      {/* Signup Section */}
      <div style={styles.section}>
        <h2>Signup</h2>
        <div style={styles.formGroup}>
          <input
            type="text"
            name="cnic"
            placeholder="CNIC"
            value={formData.cnic}
            onChange={handleChange}
            style={styles.input}
          />
          <input
            type="text"
            name="name"
            placeholder="Name"
            value={formData.name}
            onChange={handleChange}
            style={styles.input}
          />
          <input
            type="email"
            name="email"
            placeholder="Email"
            value={formData.email}
            onChange={handleChange}
            style={styles.input}
          />
          <input
            type="text"
            name="phone"
            placeholder="Phone"
            value={formData.phone}
            onChange={handleChange}
            style={styles.input}
          />
          <input
            type="text"
            name="address"
            placeholder="Address"
            value={formData.address}
            onChange={handleChange}
            style={styles.input}
          />
          <input
            type="date"
            name="dateOfBirth"
            value={formData.dateOfBirth}
            onChange={handleChange}
            style={styles.input}
          />
          <input
            type="password"
            name="password"
            placeholder="Password"
            value={formData.password}
            onChange={handleChange}
            style={styles.input}
          />
        </div>
        <button onClick={handleSignup} style={styles.button}>Sign Up</button>
      </div>

      {/* Update Section */}
      {token && (
        <div style={styles.section}>
          <h2>Update Info</h2>
          <div style={styles.formGroup}>
            <input
              type="email"
              name="newEmail"
              placeholder="New Email"
              value={formData.newEmail}
              onChange={handleChange}
              style={styles.input}
            />
            <input
              type="password"
              name="newPassword"
              placeholder="New Password"
              value={formData.newPassword}
              onChange={handleChange}
              style={styles.input}
            />
            <input
              type="text"
              name="address"
              placeholder="New Address"
              value={formData.address}
              onChange={handleChange}
              style={styles.input}
            />
            <input
              type="text"
              name="phone"
              placeholder="New Phone"
              value={formData.phone}
              onChange={handleChange}
              style={styles.input}
            />
            <input
              type="text"
              name="city"
              placeholder="New City"
              value={formData.city}
              onChange={handleChange}
              style={styles.input}
            />
            <input
              type="text"
              name="constituency"
              placeholder="New Constituency"
              value={formData.constituency}
              onChange={handleChange}
              style={styles.input}
            />
          </div>
          <button onClick={handleUpdate} style={styles.button}>Update</button>
        </div>
      )}

      {/* Verify Section */}
      {token && (
        <div style={styles.section}>
          <h2>Verify</h2>
          <div style={styles.formGroup}>
            <input
              type="text"
              name="twoFactorCode"
              placeholder="Two-Factor Code"
              value={formData.twoFactorCode}
              onChange={handleChange}
              style={styles.input}
            />
          </div>
          <button onClick={handleVerify} style={styles.button}>Verify</button>
        </div>
      )}
    </div>
  );
};

const styles = {
  container: {
    maxWidth: '600px',
    margin: '0 auto',
    padding: '20px',
    textAlign: 'center',
    fontFamily: 'Arial, sans-serif',
  },
  section: {
    marginBottom: '30px',
  },
  formGroup: {
    marginBottom: '20px',
  },
  input: {
    display: 'block',
    width: '100%',
    padding: '10px',
    margin: '10px 0',
    border: '1px solid #ccc',
    borderRadius: '5px',
  },
  button: {
    padding: '10px 20px',
    margin: '10px',
    backgroundColor: '#007BFF',
    color: '#fff',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
  },
};

export default VoterManagement;
